INSERT INTO tv_show (title, description, release_year, language_id, original_language_id, rating) VALUES
("Blood & Water","After crossing paths at a party, a Cape Town teen sets out to prove whether a private-school swimming star is her sister who was abducted at birth.",2021,1,1,"NC-17"),
("Ganglands","To protect his family from a powerful drug lord, skilled thief Mehdi and his expert team of robbers are pulled into a violent and deadly turf war.",2021,1,1,"NC-17"),
("Jailbirds New Orleans","Feuds, flirtations and toilet talk go down among the incarcerated women at the Orleans Justice Center in New Orleans on this gritty reality series.",2021,1,1,"NC-17"),
("Kota Factory","In a city of coaching centers known to train India’s finest collegiate minds, an earnest but unexceptional student and his friends navigate campus life.",2021,1,1,"NC-17"),
("Midnight Mass","The arrival of a charismatic young priest brings glorious miracles, ominous mysteries and renewed religious fervor to a dying town desperate to believe.",2021,1,1,"NC-17"),
("The Great British Baking Show","A talented batch of amateur bakers face off in a 10-week competition, whipping up their best dishes in the hopes of being named the U.K.'s best.",2021,1,1,"PG-13"),
("Vendetta: Truth, Lies and The Mafia","Sicily boasts a bold \"Anti-Mafia\" coalition. But what happens when those trying to bring down organized crime are accused of being criminals themselves?",2021,1,1,"NC-17"),
("Bangkok Breaking","Struggling to earn a living in Bangkok, a man joins an emergency rescue service and realizes he must unravel a citywide conspiracy.",2021,1,1,"NC-17"),
("Crime Stories: India Detectives","Cameras following Bengaluru police on the job offer a rare glimpse into the complex and challenging inner workings of four major crime investigations.",2021,1,1,"NC-17"),
("Dear White People","Students of color navigate the daily slights and slippery politics of life at an Ivy League college that's not nearly as \"post-racial\" as it thinks.",2021,1,1,"NC-17"),
("Falsa identidad","Strangers Diego and Isabel flee their home in Mexico and pretend to be a married couple to escape his drug-dealing enemies and her abusive husband.",2020,1,1,"NC-17"),
("Jaguar","In the 1960s, a Holocaust survivor joins a group of self-trained spies who seek justice against Nazis fleeing to Spain to hide after WWII.",2021,1,1,"NC-17"),
("Monsters Inside: The 24 Faces of Billy Milligan","In the late 1970s, an accused serial rapist claims multiple personalities control his behavior, setting off a legal odyssey that captivates America.",2021,1,1,"PG-13"),
("Resurrection: Ertugrul","When a good deed unwittingly endangers his clan, a 13th-century Turkish warrior agrees to fight a sultan's enemies in exchange for new tribal land.",2018,1,1,"PG-13"),
("Love on the Spectrum","Finding love can be hard for anyone. For young adults on the autism spectrum, exploring the unpredictable world of dating is even more complicated.",2021,1,1,"PG-13"),
("Chicago Party Aunt","Chicago Party Aunt Diane is an idolized troublemaker with a talent for avoiding adulthood — and a soft spot for her soul-searching nephew.",2021,1,1,"NC-17"),
("Sex Education","Insecure Otis has all the answers when it comes to sex advice, thanks to his therapist mom. So rebel Maeve proposes a school sex-therapy clinic.",2020,1,1,"NC-17"),
("Squid Game","Hundreds of cash-strapped players accept a strange invitation to compete in children's games. Inside, a tempting prize awaits — with deadly high stakes.",2021,1,1,"NC-17"),
("Tayo and Little Wizards","Tayo speeds into an adventure when his friends get kidnapped by evil magicians invading their city in search of a magical gemstone.",2020,1,1,"PG"),
("Angry Birds","Birds Red, Chuck and their feathered friends have lots of adventures while guarding eggs in their nest that pesky pigs keep trying to steal.",2018,1,1,"PG"),
("Chhota Bheem","A brave, energetic little boy with superhuman powers leads his friends on exciting adventures to guard their fellow Dholakpur villagers from evil.",2021,1,1,"PG"),
("He-Man and the Masters of the Universe","Mighty teen Adam and his heroic squad of misfits discover the legendary power of Grayskull — and their destiny to defend Eternia from sinister Skeletor.",2021,1,1,"PG"),
("The Smart Money Woman","Five glamorous millennials strive for success as they juggle careers, finances, love and friendships. Based on Arese Ugwu's 2016 best-selling novel.",2020,1,1,"NC-17"),
("Castle and Castle","A pair of high-powered, successful lawyers find themselves defending opposite interests of the justice system, causing a strain on their happy marriage.",2021,1,1,"NC-17"),
("Dharmakshetra","After the ancient Great War, the god Chitragupta oversees a trial to determine who were the battle's true heroes and villains.",2014,1,1,"PG"),
("Nailed It","Home bakers with a terrible track record take a crack at re-creating edible masterpieces for a $10,000 prize. It's part reality contest, part hot mess.",2021,1,1,"PG"),
("Numberblocks","In a place called Numberland, math adds up to tons of fun when a group of cheerful blocks work, play and sing together.",2021,1,1,"G"),
("Raja Rasoi Aur Anya Kahaniyan","Explore the history and flavors of regional Indian cuisine, from traditional Kashmiri feasts to the vegetarian dishes of Gujarat.",2014,1,1,"G"),
("Saved by the Bell","From middle school to college, best friends Zack, Kelly, Slater, Jessie, Screech and Lisa take on the highs and lows of life together in this hit series.",1994,1,1,"PG"),
("Stories by Rabindranath Tagore","The writings of Nobel Prize winner Rabindranath Tagore come to life in this collection of tales set in early-20th-century Bengal.",2015,1,1,"PG"),
("Too Hot To Handle: Latino","On this reality show, singles from Latin America and Spain are challenged to give up sex. But here, abstinence comes with a silver lining: US$100,000.",2021,1,1,"NC-17"),
("Jack Whitehall: Travels with My Father","Jovial comic Jack Whitehall invites his stuffy father, Michael, to travel with him through Southeast Asia in an attempt to strengthen their bond.",2021,1,1,"NC-17"),
("The World's Most Amazing Vacation Rentals","With an eye for every budget, three travelers visit vacation rentals around the globe and share their expert tips and tricks in this reality series.",2021,1,1,"PG"),
